import React from 'react';
import './Leaderboard.css';
import './Card.css'; // Import shared card style

function Leaderboard() {
  const projects = [
    { name: 'SAP Prediction', points: 112 },
    { name: 'Escalation Redesign', points: 101 },
    { name: 'Transcript Analysis', points: 90 },
    { name: 'Log Analytics', points: 61 },
    { name: 'Transfer Root Cause', points: 56 },
  ];

  return (
    <section className="card">
      <h2>Leaderboard</h2>
      <table>
        <thead>
          <tr>
            <th>Project</th>
            <th>Points</th>
          </tr>
        </thead>
        <tbody>
          {projects.map((project, index) => (
            <tr key={index}>
              <td>{project.name}</td>
              <td>{project.points}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </section>
  );
}

export default Leaderboard;
